import person1 from './images/person1.jpg'
import logout from './images/logout.svg'

const Profile = () => {
    return (
        <div className='profile-container' >
            <img id='image1' src= {person1} />
            <h2>Regina</h2><br></br>
            <img id='logout' src={logout}/>
            <h3>Logout</h3>
            
        </div>
    )
}

export default Profile
